// src/components/About.js
import React from 'react';
import Connect from '../components/Connect';
const DashBoard = () => {
  return (
    <div>
      <Connect/>
      <h1>About Us</h1>
      <p>This is the About page of our React Router test application.</p>
    </div>
  );
};

export default DashBoard;
